import React, { useState } from "react";



let Button = ()=>{
    
    const bgColor = '#43BFC7';
    const btnName = "Click Me";
    const btnColor = "#737CA1";

    const [curbgColor, setbgColor] = useState(bgColor);
    const [curbtnName, setbtnName] = useState(btnName);
    const [curbtnColor, setbtnColor] = useState(btnColor);



    return(
        <>
          <div style= {{backgroundColor: curbgColor, height: "700px"}}>
              <button style= {{backgroundColor: curbtnColor, margin: "320px 600px", padding: "20px 70px", 
              borderRadius: "7px", fontSize: "10px"}} className= "mybtn"> {curbtnName} </button>
          </div>
        </>
    )
}



export default Button;
